  return (
   
        
        <div className="profile-container pc ">
        <div className='icon-container'>
  <img src={ClickUser.profilePhoto}  alt=''/>
  <div className='st status-circle'>
  <span>{ClickUser.Fullname}</span>
  </div>

</div>  </div> 
   
  )
}

export default ActiveChat;
